use std::collections::HashMap;

use axum::{
    extract::{Path, State},
    response::{IntoResponse, Response},
    Json,
};
use serde::{Deserialize, Serialize};

use crate::AppState;

const KILL_STATISTICS_URL: &'static str =
    "https://www.tibia.com/community/?subtopic=killstatistics";

const WORLDS_URL: &'static str = "https://www.tibia.com/community/?subtopic=worlds";

#[derive(Serialize, Deserialize, Debug)]
pub struct PathParams {
    world: String,
}

#[axum::debug_handler]
pub async fn get_worlds(State(state): State<AppState>) -> Response {
    let client = state.client;

    let response = client.get(WORLDS_URL).send().await.unwrap();
    let page_as_str = response.text().await.unwrap();
    // let page_as_str = HTML_WORLDS;
    // println!("{page_as_str}");

    let worlds = tibia_api::scrape_worlds(&page_as_str);

    let json = Json(worlds);
    json.into_response()
}

#[axum::debug_handler]
pub async fn get_kill_statistics(
    State(state): State<AppState>,
    Path(path_params): Path<PathParams>,
) -> Response {
    let client = state.client;

    // Form data
    let mut params = HashMap::new();
    params.insert("world", path_params.world);

    let response = client
        .post(KILL_STATISTICS_URL)
        .form(&params)
        .send()
        .await
        .unwrap();

    let page_as_str = response.text().await.unwrap();
    // let page_as_str = HTML_KILL;
    // println!("{page_as_str}");

    let stats = tibia_api::scrape_kill_statistics(&page_as_str);

    let json = Json(stats);
    json.into_response()
}

